import * as style from "../../css/light/focusedList";
import ProfileHistory from './profileHistory';
import AssociatedItem from './associatedItem';

let focusedContainer = {
  width: "100%", 
  marginTop: "35px", 
  height: "825px", 
  border: "1px solid #e8fefd"
}

function FocusedTitle({focusedItem}) {
  return (
    <div style={style.focusedTitleContainer}>
      <div style={{width: "100%"}}></div>  
      <div style={style.focusedItemTitle}>{focusedItem.resources[0].data.userid}</div>
      <div style={{display: "flex", width: "100"}}>
        <div style={{userSelect: "none", fontSize: "25px", cursor: "pointer", lineHeight: "17px", width: "auto", transform: "rotate(45deg)", marginLeft: "auto", marginRight: "5px"}}>+</div>
      </div>
      {/* <div onClick={() => {props.setTempItem(item); handleFocusChange(item)}} style={style.focusClose}>+</div> */}
    </div>
  )
}


export default function FocusedList({focused}) {
  if (!focused[0]) return <div></div>
  let focusedItem = require(`../../data/${focused[1]}/${focused[0]}.json`)

  if (focusedItem.resources[0].data.associatedDevices) {
    return (
      <div style={focusedContainer}>
        <FocusedTitle focusedItem={focusedItem}/>
